import './App.css';
import { Routes, Route } from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomePage />} />
        <Route path="" element={<CreateTeamPage /> } />
        <Route path="" element={<YourTeamPage />} />
      </Routes>
    </div>
  );
}

export default App;
